            //     )
            // }
            panels.push(
                <section className="emoticons-panel" key={'pannel-'+i}>
                    {/* {panel} */}
                </section>
            )
        }
        return panels;
    }, [])

    console.log("render emoti")
    return (
        <div className="emoticons-container">
            {iconsPanels}
        </div>
    )
}

export default EmotiContainer;
